function getData(data) {
  let profileList = []

  data['data'].forEach((profile, i) => {
    profileList.push([
      {
        type: "mac",
        index: "MAC Address",
        data: (() => {
          try {return profile['data']['name'].toUpperCase()}
          catch {return ""}
        })()
      },
      {
        type: "product",
        index: "Product",
        data: (() => {
          try {return profile['data']['product']}
          catch {return ""}
        })()
      },
      {
        type: "user",
        index: "User ID",
        data: (() => {
          try {return profile['data']['ownerUserName']}
          catch {return ""}
        })()
      },
      {
        type: "description",
        index: "Description",
        data: (() => {
          try {return profile['data']['description']}
          catch {return ""}
        })()
      },
      {
        type: "primary",
        index: "Primary Line",
        data: (() => {
          try {return profile['data']['lines']['line'][0]['dirn']['pattern']}
          catch {return ""}
        })()
      },
      {
        type: "mask",
        index: "E164 Mask",
        data: (() => {
          try {return profile['lines']['line'][0]['e164Mask']}
          catch {return ""}
        })()
      },
      {
        type: "location",
        index: "Location",
        data: (() => {
          try {return profile['meta']['hierarchy']}
          catch {return ""}
        })()
      }
    ])
  })

  return profileList
}
